def minPath(grid, k):
    N = len(grid)
    min_path = [float('inf')] * k

    def dfs(x, y, path):
        if len(path) == k:
            nonlocal min_path
            min_path = min(min_path, path.copy())
            return
        for dx, dy in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                path.append(grid[nx][ny])
                dfs(nx, ny, path)
                path.pop()

    for i in range(N):
        for j in range(N):
            dfs(i, j, [grid[i][j]])

    return min_path

def tri(n):
