    if n == 1:
        return seq
    for i in range(2, n + 1):
        if i % 2 == 0:
            seq.append(1 + i // 2)
        else:
            if i + 1 <= n:  # Check if i + 1 is within bounds
                seq.append(seq[i - 1] + seq[i - 2] + seq[i - 1] + 1 + (i + 1) // 2)
            else:
                seq.append(seq[i - 1] + seq[i - 2] + 1 + (i + 1) // 2)  # Use a placeholder for tri(i + 1)
    return seq

